import React from 'react';

const Navbar = () => (
  <nav>
    <ul>
      <li><a href="#about">About</a></li>
      <li><a href="#education">Education</a></li>
      <li><a href="#skills">Skills</a></li>
      <li><a href="#interests">Interests</a></li>
      <li><a href="#projects">Projects</a></li>
    </ul>
  </nav>
);

export default Navbar;
